import Slider from './Components/slider/Slider';
import Testimonial from './Components/testmonial/Testimonial';
import Contact from './Components/contact/Contact';

function App() {
  return (
    <div className="app">
      <Navbar />
      <div className="sections">
        <Home />
        <Portfolio />
        <Slider />
        <Testimonial />
        <Contact />
      </div>
    </div>
  );
}

export default App;
